gNI:function(){return"Wie funktioniert die App im Hintergrund"},
gNC:function(){return"Das System ist auf Anonymit\xe4t und Datenschutz ausgelegt, weshalb wir uns gegen einen Ansatz mit Location-Tracking entschieden haben. Statt dessen verwenden wir QR-Codes, die bei der Teilnahme an einem Event eingescannt werden k\xf6nnen.\nDie QR-Codes beinhalten jeweils den Namen des Events, so wie eine eindeutige, zuf\xe4llig generierte ID.\nDiese Daten werden ausschlie\xdflich auf den Ger\xe4ten der Teilnehmer:innen und Veranstalter:innen gespeichert.\nWenn nun ein User ein positives Testergebnis best\xe4tigt, werden die ID\u2019s aller Events, die er in den letzten 14 Tagen besucht hat zusammen mit dem Zeitraum der Anwesenheit an einen zentralen Server geschickt, und dort hinterlegt. Da lediglich die Event-ID hinterlegt wird, kann der Server nicht ermitteln, um was f\xfcr ein Event es sich handelt.\nAlle Ger\xe4te mit installierter App pr\xfcfen in regelm\xe4\xdfigen Abst\xe4nden, ob eine der von ihnen besuchten Event-ID\u2019s auf dem Server hinterlegt wurde, und falls dem so ist, ob sich die Zeitr\xe4ume \xfcberschneiden. Falls ja, schl\xe4gt die App alarm und die Nutzer:innen k\xf6nnen sich testen lassen.\nSollte die App erkennen, dass die ID eines eigenen Events auf dem Server hinterlegt ist, wird zus\xe4tzlich die Liste der manuell hinzugef\xfcgten Teilnehmer:innen und deren Anwesenheitszeiten mit den auf dem Server hinterlegten Zeiten abgeglichen. Sollten manuell hinzugef\xfcgte Teilnehmer:innen in dem fraglichen Zeitraum das Event besucht haben, werden deren Pers\xf6nlichen Daten in verschl\xfcsselter Form an den Server gesendet, welcher sie weiter an das Gesundheitsamt leitet. Dort k\xf6nnen die Daten wieder entschl\xfcsselt werden um die betreffenden Personen zu informieren (SMS, Telefon, Post)."},
