gNC:function(){return"The system is optimised for anonymity and data security, which is why we decided against a approach using location tracking. Instead, we used QR codes which are scanned when entering an event.\n The QR codes contain the name of the event as well as a unique randomly generated ID.\n This information are saved exclusively on the users devices.\nIn the case a user confirms a positive test result, the ids of all events they visited in the last 14 days are uploaded to the server alongside the timeframe of their visit. Since we receive only the event id, we are unable to determine, which event that is.\nAll devices which have the app installed check in regular intervals whether an event id they visited was published on the server, and if that's the case, whether the servers timeframe and the apps own visit overlap. If that is also the case, the app reacts by alarming the user.\nShould the app detect an id of an event that it created, it also repeats the comparison of timeframes and conditional upload for the list of manually added visitors. In any case, any personal data send to the server is encrypted and only readable by the Ministry of health, not our own server. Said ministry can then contact the affected individuals and contact them as they see fit"},
